            }/>
        <Route path='/seleccion' 
            element={

               <>
                   <PantallaSeleccion/>
               </>
            }/>

        <Route path='/principal' 
            element={
               <>
                <Pantallaprincipal/>
               </>
            }/>

    </Routes>    
</>

